import React from "react";

import { useForm } from "react-hook-form";

import { AuthInput } from "../../components/forms";

export const Login = () => {
  const {
    register,
    handleSubmit,
    setError,
    formState: { defaultValues, errors, isValid },
  } = useForm({
    defaultValues: {
      email: "",
      password: "",
    },
    mode: "onChange",
  });

  const onSubmit = (values) => {
    console.log(values);
  };

  return (
    <div className="login-container">
      <form onSubmit={handleSubmit(onSubmit)}>
        <AuthInput {...register("email", { required: "Enter email" })} />
        <AuthInput {...register("password", { required: "Enter password" })} />
        <button type="submit">Sumbmit</button>
      </form>
    </div>
  );
};

export default Login;
